//必須
import React, { Component } from 'react';

//Appクラス = Appコンポーネント(カスタムタグ)
class App extends Component {
  render() {
    return (
      //returnの中にJSXを記載
      <div className="driver">
        <h2>質問</h2>
      </div>
    );
  }
}

//他の場所で読み込んで使えるようにexport
export default App;
